import styled from 'styled-components';

const Login = (props) =>{
  return (
    <Container>
      <Nav>
        <a href="/">
          <img src="./images/login-logo.svg" />
        </a>
      </Nav>
    </Container>
  )
}
const Container = styled.div``;
const Nav = styled.nav`
  max-width: 112px;
  margin: auto;
  padding: 12px 0 16px;
  display: flex;

  align-items: center;
  position: relative;
  flex-wrap: nowrap;
  & > a {
    width: 135px;
    height: 24px;
    @media(max-width: 768px){
      padding: 0 5px;
    }
  }
`;

export default Login;
